import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import PersonaService from '../services/PersonaService';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css'; // Asegúrate de tener Bootstrap instalado

const Register = () => {
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    primerNombre: '',
    segundoNombre: '',
    primerApellido: '',
    segundoApellido: '',
    email: '',
    fechaNacimiento: '',
  });
  const [error, setError] = useState('');
  const navigate = useNavigate(); // Para redirigir al usuario después del registro

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Registra el usuario
      await PersonaService.createPerson(formData);
      
      // Inicia sesión utilizando las credenciales del usuario registrado
      const loginResponse = await PersonaService.loginUser({
        username: formData.username,
        password: formData.password,
      });

      // Guarda el token en localStorage
      localStorage.setItem('token', loginResponse.token);

      // Redirige a la página de inicio o donde desees
      navigate('/home');
    } catch (error) {
      setError('Error al registrar el usuario. Asegúrate de que los datos sean correctos.');
      console.error('Error en el registro:', error);
    }
  };

  const handleLogout = () => {
    Swal.fire({
      title: '¿Estás seguro que deseas cerrar sesión?',
      icon: 'warning',
      showCancelButton: true,
      confirmButtonColor: '#3085d6',
      cancelButtonColor: '#d33',
      confirmButtonText: 'Sí, cerrar sesión',
      cancelButtonText: 'Cancelar'
    }).then((result) => {
      if (result.isConfirmed) {
        localStorage.removeItem('token');
        navigate('/login');
      }
    });
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center">Registro de Usuario</h2>
      <form onSubmit={handleSubmit} className="mt-4">
        <div className="mb-3">
          <label htmlFor="username" className="form-label">Username</label>
          <input
            type="text"
            id="username"
            name="username"
            className="form-control"
            value={formData.username}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="password" className="form-label">Password</label>
          <input
            type="password"
            id="password"
            name="password"
            className="form-control"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="primerNombre" className="form-label">Primer Nombre</label>
          <input
            type="text"
            id="primerNombre"
            name="primerNombre"
            className="form-control"
            value={formData.primerNombre}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="segundoNombre" className="form-label">Segundo Nombre</label>
          <input
            type="text"
            id="segundoNombre"
            name="segundoNombre"
            className="form-control"
            value={formData.segundoNombre}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label htmlFor="primerApellido" className="form-label">Primer Apellido</label>
          <input
            type="text"
            id="primerApellido"
            name="primerApellido"
            className="form-control"
            value={formData.primerApellido}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="segundoApellido" className="form-label">Segundo Apellido</label>
          <input
            type="text"
            id="segundoApellido"
            name="segundoApellido"
            className="form-control"
            value={formData.segundoApellido}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label htmlFor="email" className="form-label">Email</label>
          <input
            type="email"
            id="email"
            name="email"
            className="form-control"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="fechaNacimiento" className="form-label">Fecha de Nacimiento</label>
          <input
            type="date"
            id="fechaNacimiento"
            name="fechaNacimiento"
            className="form-control"
            value={formData.fechaNacimiento}
            onChange={handleChange}
            required
          />
        </div>
        {error && <div className="alert alert-danger">{error}</div>}
        <button type="submit" className="btn btn-primary">Registrar</button>
      </form>
    </div>
  );
};

export default Register;
